import {  Navbar, Nav } from 'react-bootstrap';
import './Header.css'; 
export default function NavBar({logo}) {

  return( 
    <Navbar bg="light" expand="lg" className="menu-bar">
          <Navbar.Toggle aria-controls="menubar" />
          <Navbar.Brand href="#">
            <img
              src={logo} 
              alt="Brand Logo"
              className="brand-logo d-block d-lg-none mx-auto"
            />
          </Navbar.Brand>
          <Navbar.Collapse id="menubar">
            <Nav className="me-auto">
              <Nav.Link href="/" className="nav-item">Home</Nav.Link>
              <Nav.Link href="/products" className="nav-item">Products</Nav.Link>
              <Nav.Link href="/about" className="nav-item">About Us</Nav.Link>
              <Nav.Link href="/contact" className="nav-item">Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
      </Navbar>
  ); 
}
